import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';

function DrawerAppbar(){
  return (
    <React.Fragment>
      <Box sx={{flexGrow: 1}}>
        <h1>ana are mere</h1>
      </Box>
    </React.Fragment>
  );
}

export default DrawerAppbar;
